description:
This torrent was created and uploaded to The Pirate Bay for
members of the PornHub community who would like to have the
videos of PornHub community amateur &quot;Lusty-Pink&quot;, who seems
to have deleted her videos at some point during the summer
or autumn of 2017.
&#x200A;
&#x200A;
There are 31 files altogether; as the files are all in MP4
format, compressing them into a zip archive would have saved
very little space (I checked) and I left them as they are.
The 31 files occupy about 3.1 GB worth of space and add up
to just over 5 hours worth of video, yielding an average
bitrate across all files of about 1,440 kbps.
&#x200A;
&#x200A;
All files are in 720p.
&#x200A;
&#x200A;
Enjoy.
